import React from "react";
import styles from './styles.js';

export const Footer = ({width}) => {
    return <>
    <div style={styles.column}>
        <h4 style={{ margin: 0 }}>
            TURTLE FUNCTIONS
        </h4>

        <div style={{ ...styles.row, maxWidth: width - 48 }}>
            <button style={styles.blueButton}>
                Hexagon
            </button>
        </div>
    </div>
    </>
};
